import React from 'react';
import Footer from './Footer';
import Form from './form';
import {Styles} from "./formStyles";

function App() {
  return (
      <React.Fragment>
      <Styles>
          <Form/>
      </Styles>
      <Footer/>
      </React.Fragment>
  );
}

export default App;
